
public class Firstfunctionexample {
	
	static void iMoji(char ch)
	{
		for(int i=0;i<=30;i++) {
			System.out.print(ch);
		}
		
		System.out.println("\n");
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		iMoji('*');
		iMoji('*');
		iMoji('*');
		iMoji('*');
		iMoji('*');
		
		
		

	}

}
